import React from "react";
//import { BrowserRouter, Route, Link } from "react-router-dom";

import Login  from "../components/login"
import Header from "../components/header";
import Burger from "../components/burger";
import Section from "../components/section";
import Screen from "../components/screen"
import logo from "./MYtineraryLogo.png"
import Visit from "../components/visit"
import "../App.css";

class Itinarries extends Component {
  constructor(props) {
    super(props)
    this.state = {"cities": [] }
 } 

  render() {
    return (
      <div>
        <div>
          <Section layout="HeaderLayout">
            <Header />
            <Login />
            <Burger />
          </Section>
          <div className="centered">
            <img className="logo" src={logo} alt="" />
            <p className="Greeting">
              Find your perfect trip, designed by insiders who know and love their
              cities.
              <Visit />
            </p>
          </div>
        </div>
        <p>Popular MYtinaries</p>
        <Section layout="Flexbox">
          <Screen player="1" location="barcelona: Gaudi in a Day" />
          <Screen player="2" location="New York: Brooklin Pizza"/>
          <Screen player="3" location="Amsterdam Red Light Green Llght"/>
          <Screen player="4" location="Paris Champange at the Eifel"/>
        </Section>
      </div>
    )
  }

  componentDidMount() {
    fetch( 'http://localhost:5000/api/tinerary/search?city=Barcelona' + this.state.cities ) 
      .then(response =>response.json())
      .then(data => {this.setState({"cities": data}); console.log(data)});
}

} /* end class itinararies */

export default Itinararies;
/* last line */
